import React, { useState, useEffect } from 'react';
import StockCard from '../components/Stock_card';

const StocksPage = () => {
  const [stocks, setStocks] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const stocksPerPage = 30;

  // Mock data for stocks
  const mockStocks = [
    { id: 1, symbol: 'AAPL', name: 'Apple Inc.', price: 150.25, change: 2.5, volume: 1000000 },
    { id: 2, symbol: 'GOOGL', name: 'Alphabet Inc.', price: 2800.5, change: -1.75, volume: 500000 },
    { id: 3, symbol: 'AMZN', name: 'Amazon.com Inc.', price: 3400.0, change: 0.25, volume: 750000 },
    { id: 4, symbol: 'MSFT', name: 'Microsoft Corporation', price: 250.75, change: 1.75, volume: 900000 },
    { id: 5, symbol: 'TSLA', name: 'Tesla Inc.', price: 650.5, change: -3.25, volume: 600000 },
    { id: 6, symbol: 'FB', name: 'Facebook Inc.', price: 350.0, change: 0.5, volume: 400000 },
    { id: 7, symbol: 'NVDA', name: 'NVIDIA Corporation', price: 800.25, change: -2.75, volume: 300000 },
    { id: 8, symbol: 'V', name: 'Visa Inc.', price: 220.0, change: 1.0, volume: 200000 },
    { id: 9, symbol: 'JPM', name: 'JPMorgan Chase & Co.', price: 160.75, change: -0.5, volume: 150000 },
    { id: 10, symbol: 'WMT', name: 'Walmart Inc.', price: 130.5, change: 0.25, volume: 100000 },
    { id: 11, symbol: 'PG', name: 'Procter & Gamble Company', price: 140.25, change: 0.75, volume: 80000 },
    { id: 12, symbol: 'BAC', name: 'Bank of America Corporation', price: 40.0, change: 0.25, volume: 60000 },
    { id: 13, symbol: 'NFLX', name: 'Netflix Inc.', price: 500.5, change: -1.5, volume: 40000 },
    { id: 14, symbol: 'XOM', name: 'Exxon Mobil Corporation', price: 60.0, change: 0.5, volume: 30000 },
    { id: 15, symbol: 'AMD', name: 'Advanced Micro Devices Inc.', price: 120.75, change: -0.75, volume: 20000 },
    { id: 16, symbol: 'BA', name: 'The Boeing Company', price: 220.0, change: 1.0, volume: 10000 },
    { id: 17, symbol: 'KO', name: 'The Coca-Cola Company', price: 55.25, change: 0.25, volume: 5000 },
    { id: 18, symbol: 'DIS', name: 'The Walt Disney Company', price: 180.5, change: 0.5, volume: 2000 },
    { id: 19, symbol: 'INTC', name: 'Intel Corporation', price: 60.0, change: -0.5, volume: 1000 },
    { id: 20, symbol: 'CMCSA', name: 'Comcast Corporation', price: 55.25, change: 0.25, volume: 500 },
    { id: 21, symbol: 'CSCO', name: 'Cisco Systems Inc.', price: 55.5, change: 0.5, volume: 200 },
    { id: 22, symbol: 'PFE', name: 'Pfizer Inc.', price: 40.0, change: -0.25, volume: 100 },
    { id: 23, symbol: 'VZ', name: 'Verizon Communications Inc.', price: 55.25, change: 0.0, volume: 50 },
    { id: 24, symbol: 'TMUS', name: 'T-Mobile US Inc.', price: 120.5, change: -0.25, volume: 25 },
    { id: 25, symbol: 'PEP', name: 'PepsiCo Inc.', price: 150.0, change: 0.25, volume: 10 },
    { id: 26, symbol: 'ORCL', name: 'Oracle Corporation', price: 80.25, change: 0.5, volume: 5 },
    { id: 27, symbol: 'MCD', name: "McDonald's Corporation", price: 240.5, change: 0.0, volume: 2 },
    { id: 28, symbol: 'NKE', name: 'NIKE Inc.', price: 160.0, change: -0.25, volume: 1 },
    { id: 29, symbol: 'COST', name: 'Costco Wholesale Corporation', price: 450.25, change: 0.5, volume: 0 },
    { id: 30, symbol: 'CRM', name: 'Salesforce.com Inc.', price: 250.5, change: 0.0, volume: 0 },
    { id: 31, symbol: 'TMO', name: 'Thermo Fisher Scientific Inc.', price: 500.0, change: -0.25, volume: 0 },
    ];

  useEffect(() => {
    // Set an interval to fetch stock data at a specific interval
    const fetchStocks = () => {
      setStocks(mockStocks);
    };

    const intervalId = setInterval(fetchStocks, 1000); // Fetch stock data every 1 seconds

    return () => {
      clearInterval(intervalId); // Clear the interval when the component unmounts
    };
  }, []); // Empty dependency array to only run once on component mount

  // Calculate the total number of pages based on the available stocks
  const totalPages = Math.ceil(stocks.length / stocksPerPage);

  // Handle pagination
  const goToPage = (page) => {
    setCurrentPage(page);
  };

  // Calculate the index range for the current page
  const indexOfLastStock = currentPage * stocksPerPage;
  const indexOfFirstStock = indexOfLastStock - stocksPerPage;
  const currentStocks = stocks.slice(indexOfFirstStock, indexOfLastStock);

  return (
    <div>
      {/* Render your navbar component here */}
      <div className="search-bar">
        {/* Render your search bar component here */}
      </div>
      <div className="stock-cards">
        {currentStocks.map((stock) => (
          <StockCard key={stock.id} stock={stock} />
        ))}
      </div>
      <div className="pagination">
        {Array.from({ length: totalPages }, (_, index) => index + 1).map((page) => (
          <button key={page} onClick={() => goToPage(page)}>
            {page}
          </button>
        ))}
      </div>
    </div>
  );
};

export default StocksPage;
